var Jo=!1;function tw(){return'Reddit: <a target="_blank" href="https://www.reddit.com/r/etherealfarm/">https://www.reddit.com/r/etherealfarm/</a><br/>Discord: <a target="_blank" href="https://discord.gg/9eaTxXvMT2">https://discord.gg/9eaTxXvMT2</a><br/>Github: <a target="_blank" href="https://github.com/lvandeve/etherealfarm">https://github.com/lvandeve/etherealfarm</a><br/><br/>'}
function uw(){Jo=!0;var a=Xb[1];Mt()&&(a=$b);a=Ta({title:"About",icon:a,onclose:function(){Jo=!1},Ra:!0});var b="Ethereal Farm<br/><br/>"+tw();b+="Game version: Ethereal Farm v"+vw();a.content.a.innerHTML=b+'<br/><br/>Changelog:<br/><br/>0.1.102 (2022-04-18):<br/>\u2022 Added stormy challenge with perma weather reward.<br/>\u2022 Added 6 new higher level ethereal crops.<br/>\u2022 Added reward level caps to basic and truly basic challenge, and tweaked their bonuses to give more earlier, but diminishing returns later. The caps are very high and not intended to be reached as this takes a long time and rewards are very diminishing at that point.<br/>\u2022 Mushroom boost and nettle boost fruit abilities a bit increased.<br/>\u2022 Shift + click, and shift + number key in blueprint dialog now plants with overriding rather than without (and the ctrl shortcut got deprecated).<br/>\u2022 Reorganized the challenge info dialog in more sections to more easily find rules, goal and rewards between the text.<br/>\u2022 Bugfixes.<br/><br/>0.1.101 (2022-04-16):<br/>\u2022 A new first flower tier, anemone, is now available after blackberry instead of cranberry, much sooner, to improve the early game experience.<br/>\u2022 Lategame flower prices and effects are the same (including prestiged anemone which is what sunflower used to be).<br/>\u2022 In the ethereal field flowers changed names, but the effects are same as before.<br/>\u2022 This causes some achievements (for highest flower tier) to have to be re-earned, sorry for the incovenience.<br/>\u2022 Mushroom and flower achievements give a slightly higher boost.<br/>\u2022 Seeds income now only shows a gray numeric value if more than two thirds of seed production goes to mushrooms (as a warning), and it now shows the potential total production, rather than a negative value.<br/>\u2022 The blueprint dialog now supports shortcut keys 1-9 to select a blueprint.<br/><br/>0.1.100 - Fruity update (2022-04-10):<br/>\u2022 Added sapphire fruits, and new fruit abilities only available from this tier.<br/>\u2022 New fruit mixing type, unlocked by new squirrel upgrade. The original dragon fruit got renamed to star fruit, but behaves exactly the same.<br/>\u2022 Added a few extra fruit storage space upgrades and other ways to get some.<br/>\u2022 Due to UI space reasons, only the first 10 fruit slots can be selected as active now, the others are purely storage.<br/>\u2022 Added a new choice upgrade (resin vs production).<br/>\u2022 Added new crop count achievements.<br/>\u2022 Various other tweaks.<br/><br/>0.1.99 (2022-04-04):<br/>\u2022 New event started! Eggs with random rewards will drop every now and then. It will run throughout April.<br/>\u2022 Changed the graphics of the bee challenge: now it has in order: worker bee, drone, queen bee. This to avoid confusion with the differently functioning main game beehive. The queen also got a crown.<br/>\u2022 Made undeletable challenge a bit harder.<br/>\u2022 Made font sizes more consistent.<br/>\u2022 Fixed fern resource computation in case of growing flowers.<br/>\u2022 Various minor UI tweaks.<br/><br/>0.1.98c (2022-03-27):<br/>\u2022 Increased bonus of some of the resin and other achievements.<br/>\u2022 Crops in the final time units of growing will now already show the final fullgrown image (but still with progress bar).<br/>\u2022 New easier shortcut to transcend without blueprint: "t", "enter".<br/>\u2022 Exporting ethereal blueprint as TXT now inlcudes the tier numbers.<br/>\u2022 Bugfixes<br/><br/>0.1.98 - Balancing and QoL (2022-03-20):<br/>\u2022 Added a new ethereal upgrade.<br/>\u2022 Active weather can now be changed while one is running. This doesn\'t allow multiple at the same time and the use-time of the old one is lost.<br/>\u2022 Fern resources are now computed as if all crops are fullgrown, so clicking a fern is no longer bad if new crops just started growing.<br/>\u2022 In the passive fern choice, ferns that are not taken for a long time now have a chance to become bushy.<br/>\u2022 Added support for ethereal blueprints.<br/>\u2022 Using blueprints no longer requires the automaton to be present, but still requires it to be unlocked.<br/>\u2022 More tree level based achievements and more appropriate bonus values for them.<br/>\u2022 Challenge start button tooltips now mention when challenge was last run (once known).<br/>\u2022 Starting a challenge now also allows starting with blueprint more easily (with shortcuts: "t", "c", choose challenge, "b", choose blueprint).<br/>\u2022 Other UI improvements and bugfixes.<br/><br/>0.1.97 (2022-03-06):<br/>\u2022 All tiers of flowers, mushrooms and berries can now be prestiged.<br/>\u2022 Added two new nut tiers (to keep alphabetic naming order, some tier names have shifted).<br/>\u2022 Added "Plant entire field" option to automaton tab, which plants the same crop on all empty spots.<br/>\u2022 Dark scrollbars for dark mode themes (experimental browser dependent feature).<br/>\u2022 Various small tweaks and fixes.<br/><br/>0.1.96b (2022-02-25):<br/>\u2022 Fixed game balance breaking bugs.<br/><br/>0.1.96 (2022-02-09):<br/>\u2022 Added new fruit tier (rhodium)<br/>\u2022 Tweaks in earliest game: watercress upgrade from 50% to 100%, blackberry unlock needs 10 instead of 5 watercress, red tutorial arrows added.<br/>\u2022 Performance improvements.<br/>\u2022 Bugfixes.<br/><br/>0.1.95 (2022-01-19):<br/>\u2022 One more prestigeable berry added.<br/>\u2022 New ethereal crops and upgrades for ethereal tree level 9 to 12.<br/>\u2022 Holiday event ended.<br/>\u2022 Fixed issue with offline computation and the time based squirrel upgrade, and other bugfixes.<br/><br/>0.1.94 (2021-12-28):<br/>\u2022 Initial version of "prestige" released, a single berry type can be prestiged in this version.<br/>\u2022 Added one more tier of flower.<br/>\u2022 Added two new challenges (one is a harder variation of the other).<br/>\u2022 Added one more completion target level for the rocks challenge.<br/>\u2022 Various small fixes.<br/><br/>0.1.93 (2021-12-17):<br/>\u2022 Holiday event started!<br/>&nbsp;&nbsp;- Presents with random rewards will drop.<br/>&nbsp;&nbsp;- The squirrel and automaton got a festive hat.<br/>&nbsp;&nbsp;- This event will be active for 1 month.<br/>\u2022 Ethereal crop grow times made faster.<br/>\u2022 Other tweaks and fixes.<br/><br/>0.1.92 (2021-12-05):<br/>\u2022 Added one more tier of berry and mushroom. To keep the name order of tiers alphabetical, they are inserted in the place of certain existing crops, so some currently planted crops may have changed name and image. Their stats are the same though.<br/>\u2022 Added three more tiers of nuts.<br/>\u2022 Added eight new squirrel upgrades.<br/>\u2022 Fruit nerf: Creating a dragon fruit now requires two two-seasonal fruits with the same abilities, and a dragon fruit can no longer itself be fused with anything. This makes it more challenging to create it, but is done because it was trivial to make a dragon fruit once having one perfect two-seasonal fruit, making it irrelevant.<br/>\u2022 Fruit buff: The upgrade cost scaling of linear boost fruit abilities is now cheaper. Check your your fruit tab, since you can likely upgrade their abilities significantly. As a reminder: shift+clicking the fruit ability upgrade button will upgrade it multiple times<br/><br/>0.1.91 (2021-11-21):<br/>\u2022 Brassica/watercress winter penalty now removed when next to the tree (but no exception during the wasabi challenge anymore), so useful again during winter<br/>\u2022 Bugfixes and UI tweaks: upgrades in message log setting, wasabi during wither challenge, another \'potential\' income display bugfix, ...<br/>\u2022 Tweaks: new \'gated\' squirrel upgrade connector style, performance tweak related to infinite lifetime wasabi, added overlay text if game is computing multiple seasons after long inactivity...<br/><br/>0.1.90 "Wasabi update" (2021-11-08):<br/>\u2022 Added wasabi, the next tier of watercress, with 25% more copying and lifetime, and a challenge to unlock it.<br/>\u2022 Watercress and wasabi are of type \'brassica\', and now this name is used where \'watercress\' was used before.<br/>\u2022 Brassica are now negatively affected by winter (except during the wasabi challenge), for more seasonal variety.<br/>\u2022 Fruits of high tier dropping in main fruit storage is now a setting (off by default).<br/>\u2022 More ethereal tree achievements added and they give more bonus.<br/>\u2022 A dialog now pops up when the ethereal tree levels up with the list of things it unlocked. This because it was easy to miss its levelup before.<br/>\u2022 UI tweaks and fixes.<br/><br/>0.1.89 (2021-10-24):<br/>\u2022 High-yield watercress choice upgrade now begins at +50% copying bonus but after a while this goes down towards no bonus (it can be refreshed back to 50%), prevously this was a constant +33%. This can get more out of weather+fern combo, but is more active.<br/>\u2022 Sturdy watercress choice upgrade now only gives +50% lifetime duration, but now gives a constant +25% copying bonus. About the nerfed lifetime duration: a later update will add another form of longer duration instead.<br/>\u2022 Buffed the rainbow weather base bonus from 50% to 75%.<br/>\u2022 Added a setting for number key shortcuts: choice of activate weather, change tabs, or change active fruit slot. See main menu -> preferences -> controls.<br/>\u2022 A fruit that\'s of higher tier or season type than ever seen before can now drop in the stored fruits rather than sacrificial pool. And custom-named fruits show their name in the fruit tab when active.<br/>\u2022 Other minor QoL improvements.<br/><br/>0.1.88 (2021-10-10):<br/>\u2022 Ferns at game start now give at minimum the starter resources from ethereal ferns.<br/>\u2022 Added new choice upgrade for watercress.<br/>\u2022 Increased ethereal neighbor bonus from automaton and squirrel in the ethereal field.<br/>\u2022 Ethereal delete tokens revamp to allow more individual crop deletions and more full field replacements per season cycle:<br/>&nbsp;&nbsp;- Gives more ethereal delete tokens per season: 50% of your ethereal field cells, rather than just 2 or 3, and can carry 4x that amount.<br/>&nbsp;&nbsp;- Deleting the entire field now costs as much tokens as all individual deletions, rather than just 4 tokens, and this option is now in the automaton UI.<br/>&nbsp;&nbsp;- The reward for the "undeletable" challenge changed from ethereal token related reward to: more recoup for deleting regular crops<br/>\u2022 Certain bee related achievements now have a more fair requirement.<br/>\u2022 Watercress copying penalty when having 2 watercress reduced, but increased for more than 3 watercress.<br/>\u2022 Various UI tweaks: start-challenge button tooltips, upgrade cost in tooltips, overconsumption display fix if watercress next to mushrooms, ...<br/><br/>0.1.87 (2021-09-19):<br/>\u2022 New ethereal upgrade.<br/>\u2022 New ethereal crops. Includes bees.<br/>\u2022 Fruit tab color now hints when a non-production fruit is active.<br/>\u2022 Cosmetic tweaks.<br/><br/>0.1.86b (2021-08-28):<br/>\u2022 Fixed issue with the soft cap of grow times, so that early grow speed upgrades affect all plants at least some visible amount.<br/><br/>0.1.86 (2021-08-25):<br/>\u2022 Balanced flower upgrade costs to keep later tiers relevant.<br/>\u2022 Increased boost of squirrel upgrades for flower boost, berry boost and mushroom boost.<br/>\u2022 Fixed bug where time that resin fruit was active wasn\'t taken into account. Its bonus is supposed to only work depending on how long it was active during the last tree-level.<br/>\u2022 Ferns now give resources based on the current income when you click, rather than when they spawned or when they internally refreshed.<br/>\u2022 Resource multiplier of extra bushy ferns decreased, except for very early game. To compensate, extra bushy ferns now give a small amount of resin (0.5% of highest run for 2-minute ones). This resin itself is not counted for highest run stat, and not included in the /hr stats, but otherwise given as upcoming resin as usual.<br/>\u2022 Improved automaton heuristic for choosing which flowers to plant/upgrade first in the field, taking the other boosts of berries into account.<br/>\u2022 Bugfixes, performance improvements and other tweaks.<br/><br/>0.1.85 (2021-08-17):<br/>\u2022 Added two more tiers of nut crops<br/>\u2022 Decreased grow times of mushrooms, flowers and nuts<br/>\u2022 Wither challenge now allows using blueprints, after a new third stage of it is completed.<br/>\u2022 In the transcend dialog, shortcut key "c" added to open challenge dialog.<br/>\u2022 Other small tweaks, fixes and a performance improvement.<br/><br/>0.1.84 (2021-07-30):<br/>\u2022 Added the thistle challenge and thistle crop (next-tier nettle). Requires shiitake and tree level 66<br/>\u2022 Increased squirrel upgrade strength for the berry, mushroom, flower, bee and nettle boosts, as well as the essence boost.<br/>\u2022 Buffed weather fruit effect on the sun ability.<br/>\u2022 Fixed rightmost fruit sometimes clipped off-screen on mobile, and other fixes.<br/><br/>0.1.83 (2021-07-23):<br/>\u2022 Next fruit tier, platinum fruit, added, it has a chance to drop starting from tree level 75.<br/>\u2022 Fusing multi-season fruits with a matching single-seasonal fruit now keeps the result multi-seasonal.<br/>\u2022 Increased the achievement bonus for planting X amount of higher tier crops.<br/>\u2022 Grow speed fruit effect difference per tier made larger.<br/>\u2022 Improved "Current challenge info" dialog, with clearer old and new challenge production bonus display.<br/>\u2022 Fruit drop messages can now be disabled in the preferences.<br/>\u2022 Various other tweaks and fixes.<br/><br/>0.1.82 (2021-07-11):<br/>\u2022 1% of the challenges production bonus now also applies to resin and twigs income.<br/><br/>0.1.81 (2021-07-09):<br/>\u2022 Crops in the process of growing now count as 100% for multiplicity. This allows to change multiplicity layout without waiting for grow times.<br/>\u2022 The tree now drops a fruit every 5 levels rather than every 10 levels.<br/>\u2022 The description of the fruit grow speed ability now shows that it applies before any other reductions: the percentage value was lowered compared to 0.1.79, but back then it applied only after other reductions (to a smaller value) so this didn\'t actually decrease its power.<br/><br/>0.1.80 (2021-07-07):<br/>\u2022 Balancing to ensure getting best resin/hr after not too short runtimes:<br/>&nbsp;&nbsp;- tweaked growtime of early vs late tier crops<br/>&nbsp;&nbsp;- higher tier mushrooms now give more spores per seed rather than less spores per seed, this is a buff<br/>\u2022 Various other tweaks and fixes<br/><br/>0.1.79 (2021-06-20):<br/>\u2022 Added new ethereal upgrades, at levels 5 and 6.<br/>\u2022 Tweaked upgrade prices of berries and mushrooms so that they can\'t be cheaper than the next tier crop for the same production. This formula change makes them cheaper for lower tier crops but more expensive for higher. The new ethereal upgrades more than make up for this.<br/>\u2022 UI tweaks and fixes<br/><br/>0.1.78 (2021-06-11):<br/>\u2022 Reworked second part of the squirrel upgrade tree, replaced seasonal upgrades with new, different, ones. This solves unintended need for squirrel respeccing per season.<br/>\u2022 Free squirrel respec token for those who reached that part of the squirrel upgrades, due to those changes<br/>\u2022 It\'s now possible to do many squirrel upgrades in 1 click after respec (shift+click or new button after clicking the icon)<br/>\u2022 Turned the removed seasonal squirrel upgrades into 4 new ethereal upgrades.<br/>\u2022 Made the ethereal crops and upgrades from the previous update cheaper, and refunded the difference.<br/>\u2022 Added fifth nuts crop tier.<br/>\u2022 Added achievements for 40 crops (these do not work retroactively).<br/>\u2022 Added runtime to the best resin/hr and twigs/hr stats.<br/>\u2022 Bugfixes and UI style tweaks.<br/><br/>0.1.77 (2021-06-06):<br/>\u2022 Added new ethereal crops and upgrade (a new field size).<br/>\u2022 Added season shorten/lengthen amber abilities.<br/>\u2022 Tweaks and fixes.<br/><br/>0.1.76 (2021-06-03):<br/>\u2022 Added new ethereal crops.<br/>\u2022 Multi-season fruits now also give a slightly higher boost than the standard counterparts.<br/>\u2022 Added fourth nut crop tier.<br/>\u2022 UI style tweaks.<br/><br/>0.1.75 "Squirrel update part 2" (2021-05-29):<br/>\u2022 Added 20 new squirrel upgrades. Free respec token given so you can respec if desired<br/>\u2022 Added a third nut tier, and renamed tiers, the tiers are now: acorn, almond, brazil nut.<br/>\u2022 Tweaked the nuts cost and production to allow more squirrel upgrades: higher tiers are more expensive, but produce even more, and upgrades do more, so there is a better nuts/spores ratio. Due to the new higher cost and power of higher tiers, in older saves nuts crops are replaced by acorn.<br/>\u2022 Fruit fusing now auto-levels abilities after fusing and spends essence on this, but it never levels them higher than before fusing and leaves some essence available if a new unupgraded ability was added<br/>\u2022 Added ability to override field with blueprint (rather than not touch existing crops), using shift+click on the "To Field" button. Matching crops will be kept, but non matching ones replaced.<br/><br/>0.1.74 "Squirrel update" (2021-05-24):<br/>\u2022 Added squirrel, nuts resource and nuts crops (unlocks at ethereal tree level 5).<br/>\u2022 Added amber resource and amber processor.<br/>\u2022 Added a prelimenary small set of squirrel upgrades and amber effects to test-run the feature for now, next releases will add more content: more nut crops tiers, squirrel tech tree with interesting choices reaching beyond the nuts production limits.<br/>\u2022 Made the colors of spring and summer more easily distinguishable from each other.<br/><br/>0.1.73 (2021-05-20):<br/>\u2022 Bugfixes.<br/>\u2022 More internal changes for next update.<br/><br/>0.1.72 (2021-05-15):<br/>\u2022 Paused state is now saved in savegames.<br/>\u2022 Many internal changes for the next update, not visible or usable at this time.<br/><br/>0.1.71 (2021-05-09):<br/>\u2022 Added a pause button. Pause halts all progress, including seasons.<br/>\u2022 Various fixes, including beehive in winter accidently too low.<br/>\u2022 Development on next major feature is under way.<br/><br/>0.1.70 (2021-05-07):<br/>\u2022 The default location of back/cancel buttons in dialogs is now rightmost instead of leftmost if there are multiple bottom buttons. You can get back the original behavior in the preferences. Reason: with rightmost enabled, back buttons align, preventing accidental transcend or other action clicks when closing multiple dialogs in a row.<br/>\u2022 Various fixes<br/><br/>0.1.69 (2021-05-06):<br/>\u2022 Rockier challenge now keeps max level of each of the 5 maps separately, and gives separate bonus for each<br/>\u2022 Challenge highest level bonus now scales better for higher levels: instead of fixed bonus per level, it gives bonus per level^1.1<br/>\u2022 Replaced blueprint ctrl+shift shortcut by a new transcend-with-blueprint dialog. The fastest shortcut to transcend with blueprint is now: "t", then "b", then click chosen blueprint.<br/>\u2022 Bronze fruits are now only introduced at tree level 15, and silver at 25. Later level fruit drop rates are not affected by this change.<br/><br/>0.1.68 (2021-05-01):<br/>\u2022 Added rockier challenge (unlocks at high enough tree level)<br/>\u2022 Added the multiplicity mechanism, a bonus based on amount of crops, as reward of rockier challenge<br/>\u2022 Automaton now chooses good spots first for next auto-plant, rather than go from top to bottom<br/>\u2022 Added season effect stats to player stats dialog, and other UI tweaks<br/><br/>0.1.67 (2021-04-29):<br/>\u2022 Fruits of different types can be fused again (e.g. pineapple with pear), but the result will always be an apple. So fusing a perfect seasonal fruit is still rare, but you can use them for fusing regular fruits if desired.<br/>\u2022 Fruits now remember the random free starting levels of abilities. Fusing can now also preserve these, if two abilities are fused the result is between the two values.<br/>\u2022 The first mistletoe no longer reduces resin income or tree leveling speed. Second and higher mistletoes still do.<br/>\u2022 Bugfixes and tweaks.<br/><br/>0.1.66 (2021-04-26):<br/>\u2022 Automaton in ethereal field now gives a boost to 8 neighbors, similar to the lotus 4-neighbor boost but as its own separate multiplier.<br/>\u2022 You can now delete the entire ethereal field for 4 ethereal delete tokens.<br/>\u2022 Added some missing challenge achievements.<br/><br/>0.1.65 (2021-04-25):<br/>\u2022 New ethereal upgrades at levels 4 and 5 (ethereal berry and mushroom upgrade, ethereal field 7x6, fruit slot)<br/>\u2022 New ethereal crop (morel)<br/>\u2022 If fern left for a long time, will update its internal resources if higher. This does not benefit active play, time interval is at least as long as waiting for a new fern.<br/>\u2022 Added more stages to the rocks challenge handing out more fruit slots.<br/>\u2022 Fruits can now only be fused with others of the same type (pineapple with pineapple, ...). It\'s still easier than before fusing was introduced, when it was 100% RNG based.<br/>\u2022 Having more mistletoes affects reduces resin income more, making the choice between resin and twigs focus sharper.<br/>\u2022 Show the % bonuses given by weather abilities in various messages and windows.<br/>\u2022 Log message tooltips now also show in-game time and tree level.<br/>\u2022 More settings to disable certain log messages are added (nested under "preferences").<br/><br/>0.1.64 (2021-04-18):<br/>\u2022 Removed the Transcension II, Transcension III, etc... system (which multiplied resin and twigs by floor(tree level / 10)).<br/>\u2022 Instead, increased the base of exponentiation of resin and twigs per tree level to compensate the above. The curves have been kept as similar as possible, for levels above 45 this starts being an exponentially increasing buff<br/>\u2022 Added an alternative dark theme<br/><br/>0.1.63 (2021-04-17):<br/>\u2022 Templates now also supported in ethereal field, but not blueprints<br/>\u2022 Upgrade-crop actions and shortcuts now also work in the ethereal field<br/>\u2022 Fixed autumn increasing mushroom seed consumption while its description says it shouldn\'t<br/>\u2022 You can now ctrl+shift+click a blueprint to transcend and plant that blueprint in one go<br/>\u2022 Other small tweaks and fixes<br/><br/>0.1.62 (2021-04-13):<br/>\u2022 Mistletoe now already works while it\'s growing. This prevents issues where tree levels up before mistletoes ready when automaton plants mushrooms<br/>\u2022 The wither challenge was made of comparable difficulty as before 0.1.61 again: the production curve of withering crops tweaked to lose a bit less production initially<br/>\u2022 Resin and twigs per hour, and best per hour, stats in the top info panel.<br/>\u2022 Pressing ctrl or shift now hides tooltips.<br/>\u2022 New shortcuts: "p" picks (selects) crop under mouse cursor, or plants it on empty tile, "u" upgrades crop or blueprint template under mouse cursor, "d" deletes crop under mouse cursor. None of these requires clicking mouse button itself, and key can be held down to keep repeating the action while mouse is moved.<br/>\u2022 Added setting to disable "auto-saved" message in the log.<br/>\u2022 Now, shift+click on top-bar watercress button plants entire field full of watercress, and ctrl+click on it deletes all watercress.<br/><br/>0.1.61 (2021-04-11):<br/>\u2022 Added new ethereal upgrades for ethereal tree levels 1-3: twigs gain, blueberry secret, cranberry secret.<br/>\u2022 Berries, flowers, mushrooms, etc... now already give partial production or boost while growing.<br/>\u2022 The wither challenge got more challenging: withering now also reduces boost of flowers, nettles and beehives.<br/>\u2022 Small UI fixes and tweaks.<br/><br/>0.1.60 (2021-04-10):<br/>\u2022 Added the ability to fuse fruits, this allows adding an ability of choice to a fruit if you can collect 3 fruits with that ability. Full explanation is in fruit help.<br/>\u2022 Added ability to name blueprints<br/><br/>0.1.59 (2021-04-05):<br/>\u2022 Made blueprint watercress work and added placeable template for watercress<br/>\u2022 Added "upgrade crop" button to crop dialog, which does roughly the same as ctrl+shift+clicking it<br/>\u2022 Fruits can now be drag and dropped between slots<br/>\u2022 When no crops fullgrown yet, automaton will now upgrade blueprint to berry if can afford it even if cost limit % option is enabled (except if at 0%), to allow fast startup, as those cost limiting settings are normally used for later in a run only<br/><br/>0.1.58 (2021-04-04):<br/>\u2022 Added blueprint library, available as soon as automaton and templates are available.<br/>\u2022 Blueprint screen is accessed by clicking the tree, or pressing the "b" shortcut.<br/>\u2022 Decreased probability of two-tier lower fruits at higher tree levels.<br/>\u2022 Added shortcut keys for selecting next/previous active fruit using [ and ] (and a few alternatives).<br/>\u2022 Added shortcut key for transcend (t).<br/>\u2022 Added a "delete entire field" button to automaton that deletes all crops.<br/>\u2022 No longer uses up ethereal token when using "replace crop" in ethereal field to replace a crop with the same type.<br/><br/>0.1.57 (2021-04-03):<br/>\u2022 Added cost limit to the advanced automaton auto-unlock settings. Allows stopping auto-unlock when a crop of choice is reached.<br/>\u2022 Added 0.01%, 0.02% and 0.05% options to all percentage automaton settings.<br/>\u2022 Fruits can now be given a custom name.<br/>\u2022 Active fruit selection now works with arrows rather than a separate slot.<br/>\u2022 Added optional notification sounds in the preferences. This feature is experimental and may be removed again, because web browsers are restrictive about sound: it doesn\'t work in background tabs due to background tab pausing, doesn\'t work unless interaction with page happened, and may not work depending on other permissions.<br/><br/>0.1.56 (2021-04-02):<br/>\u2022 Added templates, which are placeholders for crop types. They do nothing but allow planning the field layout.<br/>\u2022 Templates are a new early automaton feature, unlocked immediately along with the existing automation of choice upgrades<br/>\u2022 Templates can be turned into an actual crop using ctrl+shift+click once a crop of that type is unlocked<br/>\u2022 Templates can be auto-planted by the automaton once auto-plant is available, this allows full run automation from the start<br/>\u2022 Templates are placed individually. Full-field blueprint collections are a planned feature for later<br/>\u2022 Templates are disabled during certain challenges<br/>\u2022 Lowered target level for the blackberry challenge<br/><br/>0.1.55 (2021-04-01):<br/>\u2022 Made the balancing changes of 0.1.54 milder. Depending on which state in the game, this means less extreme nerfs or less extreme buffs<br/>\u2022 Increases the effect of the resin extraction and trigs extraction upgrades, giving more resin and twigs at earlier tree level when at high enough stage of the game, to compensate for nerfs from the balance change<br/><br/>0.1.54 (2021-04-01):<br/>\u2022 Balancing of berries and mushrooms to fix issue where higher tier ones became less worth the resources<br/>\u2022 Berry and mushroom upgrades prices get a very gradual additional more-than-exponential cost increase, a soft cap to solve the above problem<br/>\u2022 To compensate, a few other stats were buffed: beehive upgrades, nettle upgrades, treelevel production bonus, and ethereal upgrade for treelevel production bonus all became slightly better than linear<br/>\u2022 Added new large number display options: hybrid with scientific instead of engineering notation<br/><br/>0.1.53 (2021-03-28):<br/>\u2022 Ethereal season upgrades now also give some mushroom benefit to summer and some berry benefit to autumn<br/>\u2022 Winter tweaks: more winter warmth base, winter warmth increases mushroom consumption, beehives affected by cold<br/>\u2022 Transcenscion now gives an additional percentage of resin and twigs, based on how many spores towards next level collected<br/>\u2022 Time countdowns now show ceil of time rather than floor and fractional seconds, and other UI tweaks<br/><br/>0.1.51 (2021-03-27):<br/>\u2022 Allow separate configuration for auto-unlock prices and auto-plant prices<br/>\u2022 Various tweaks<br/><br/>0.1.50 (2021-03-26):<br/>\u2022 Added auto-unlock for automaton, requires high enough ethereal tree and another new challenge<br/>\u2022 Added the blackberry challenge<br/>\u2022 Added ctrl+shift+click plant actions, see shortcut help dialog for info<br/>\u2022 UI tweaks<br/><br/>0.1.49 (2021-03-20):<br/>\u2022 Bugfixes<br/><br/>0.1.48 (2021-03-20):<br/>\u2022 Added auto-plant for automaton, which auto-replaces crops with better versions. Requires high enough ethereal tree and completing a new challenge to unlock<br/>\u2022 Added wither challenge<br/>\u2022 There is no auto-unlock yet (which is needed to fully automate a run), that is planned for a future version but it\'s useful to already release auto-plant now even without auto-unlock.<br/>\u2022 Fixed issue that made upgrade buttons sometimes unresponsive while automaton is doing upgrades even when having more than enough resources<br/><br/>0.1.47 (2021-03-16):<br/>\u2022 Challenge production bonus now also applies to mushrooms, significantly boosting spores output<br/>\u2022 Ethereal mushroom boost also boosts consumption now, ethereal nettles buffed a bit to compensate<br/>\u2022 Season effect rebalancing to fix the winter imbalance: before, winter scaled quadratically while other seasons only linearly with ethereal upgrades. After, all scale by n^1.25 instead.<br/>\u2022 Winter warmth now only boosts berries and mushrooms (since boosting flowers too is what made it quadratic)<br/>\u2022 Clarified in tooltip that lotus also boosts ethereal nettles<br/>\u2022 Various small UI improvements<br/><br/>0.1.46 (2021-03-14):<br/>\u2022 Bugfixes related to update timing and automaton computation.<br/>\u2022 Internal changes in preparation for future auto-plant feature (not yet finished).<br/>\u2022 Buttons to start challenges now show max reached level.<br/><br/>0.1.45 (2021-03-11):<br/>\u2022 It\'s now possible to replace crops with shift+click. Deleting is now done with ctrl+click on a crop instead.<br/>\u2022 Last unlocked crop is now also set for shift+plant.<br/>\u2022 Automatic upgrades are now only done for best type of a crop in the field. This prevents spending resources on obsolete upgrades.<br/><br/>0.1.44 (2021-03-08):<br/>\u2022 Added more ethereal crops<br/>\u2022 Added next tiers of basic crops<br/>\u2022 Re-ordered some crop names. This has no effect on stats of current games, only visual/naming. This to keep the alphabetical tier ordering after inserting new ones, noting that amanita is sorted as "muscaria"<br/>\u2022 Some crop graphics redrawn, e.g. daisy for visible contrast in winter<br/>\u2022 Auto-upgrades no longer store undo<br/>\u2022 Various fixes<br/><br/>0.1.43 (2021-03-07):<br/>\u2022 Added a second stage to the no-upgrades challenge<br/>\u2022 Added more finetuning settings for auto-upgrades, unlocked by the new stage<br/>\u2022 Many other small tweaks<br/><br/>0.1.42 (2021-03-06):<br/>\u2022 Added auto-upgrade to the automaton, requires high enough ethereal tree level and a challenge to become available<br/>\u2022 Added the no-upgrades challenge<br/>\u2022 New fruits now appear in sacrificial slots rather than storage or active slots, except the first one ever<br/>\u2022 Fix tree level-up computation during long time intervals<br/>\u2022 Other tweaks and fixes<br/><br/>0.1.41 (2021-03-01):<br/>\u2022 Added the undeletable challenge<br/>\u2022 Increased rocks challenge reward target level from 12 to 15 (nothing changes if you already got it)<br/>\u2022 Crops that depend on planting a specific crop (nettle, mistletoe and beehive) now also unlock when next higher berry is unlocked<br/>\u2022 Clicking the text "stored fruits" in fruit tab now shows where you got each slot from<br/><br/>0.1.40 (2021-02-27):<br/>\u2022 Added automaton. Can automate the choice upgrades. More features planned for later game versions<br/>\u2022 Fixed high level flower boost accidently set too low<br/>\u2022 Various tweaks and fixes<br/><br/>0.1.39 (2021-02-25):<br/>\u2022 Added two more obtainable fruit storage slots, when seeing 1 or all seasonal fruits dropped for the first time (for existing saves, this starts from 0)<br/>\u2022 Various tweaks and fixes<br/><br/>0.1.38 (2021-02-22):<br/>\u2022 Increased twigs tree level multiplier, decreased starting value to compensate: higher tree levels now give more twigs.<br/>\u2022 Season effect balancing: spring and summer should be competitive now.<br/>\u2022 Ethereal season upgrades improved and should now have same relative strength for each season.<br/>\u2022 Other minor tweaks & fixes.<br/><br/>0.1.37 (2021-02-20):<br/>\u2022 Added new high level ethereal upgrades.<br/>\u2022 Added a new high level ethereal crop.<br/>\u2022 Other balance changes.<br/>\u2022 Added icons indicating what shift/ctrl click on field will do.<br/>\u2022 Changed spring leaves color into blossom color.<br/>\u2022 Other UI tweaks<br/><br/>0.1.36 (2021-02-16):<br/>\u2022 Twigs now receive the 2x, 3x, ... higher transcenscion bonus like resin does.<br/>\u2022 Twigs gain reduced for lower tree levels, but when reaching tree level 20+ this update is a net win.<br/>\u2022 Twigs are now given at transcension rather than immediately.<br/>\u2022 Rocks challenge now also gives twigs.<br/><br/>0.1.35 (2021-02-14):<br/>\u2022 Added electrum and gold tier fruits. Electrum starts having a chance to drop at level 35.<br/>\u2022 Added seasonal fruits with extra inherent seasonal ability, can drop with lower probability then regular fruits.<br/><br/>0.1.34 (2021-02-13):<br/>\u2022 Added next higher level crop types for berry, mushroom and flower.<br/>\u2022 Autumn mushroom boost increased, and now also boosts mistletoe twigs.<br/>\u2022 Buffed the ethereal grow speed upgrade.<br/>\u2022 Made more clearly defined colors for the metal tiers (used in medals, fruits, ...).<br/>\u2022 HTML ARIA annotation improvements.<br/><br/>0.1.33 (2021-02-08):<br/>\u2022 Some challenges can have tree resin, fruit and/or twigs drop now.<br/>\u2022 Side panel upgrade tooltips now also show cost and growtime of the related plant itself.<br/>\u2022 Other UI tweaks.<br/><br/>0.1.32 (2021-02-07):<br/>\u2022 Added the "rocks" challenge, available at tree level 15.<br/>\u2022 Added ethereal upgrades for fruit slots.<br/>\u2022 Other balancing.<br/><br/>0.1.31 (2021-02-07):<br/>\u2022 Changed fern boost fruit ability into nettle boost.<br/>\u2022 Brought back the "refund for still growing plant" and made achievements based on fullgrown plants again: it turns out the QoL of this feature was more important.<br/>\u2022 Added a side panel with extra info and shortcut upgrade buttons. This only appears if the screen is wide enough.<br/>\u2022 Other UI tweaks.<br/><br/>0.1.30 (2021-02-06):<br/>\u2022 Removed the "refund still growing plant" feature since it allowed some achievement related abuse. Use the undo button instead.<br/>\u2022 Tweaked the undo button: min time between saving undo now 10 seconds instead of 1 minute (lose less work when using undo, use export save for longer term things).<br/>\u2022 Balancing changes (mostly slight buffs).<br/>\u2022 Fix issues related to playing on multiple computers with different UTC time set.<br/>\u2022 Various bee challenge bugfixes and tweaks.<br/>\u2022 Mushrooms now try to consume all resources of private berry before berries shared with other mushrooms.<br/><br/>0.1.29 "Bee update" (2021-02-06):<br/>\u2022 Added the bee challenge, which unlocks when planting a daisy (third tier flower, so it requires significant progress in the game to reach).<br/>\u2022 Added beehives, only available after successfully completing the bee challenge.<br/>\u2022 Since the necessary logic for challenges in general is added to the game for this, more will be added later.<br/><br/>0.1.28 (2021-02-03):<br/>\u2022 Fixed a bug with the previous runs level/time statistics.<br/>\u2022 Various other UI tweaks and fixes.<br/>\u2022 A larger update (bees) is coming soon, still work in progress.<br/><br/>0.1.27 (2021-01-29):<br/>\u2022 Changed fruit weather cooldown ability into weather boost.<br/>\u2022 Fixed issue with ethreal grow speed upgrade soft capping, now it should no longer accidently increase some times.<br/>\u2022 Various UI fixes.<br/><br/>0.1.26 (2021-01-28):<br/>\u2022 Minor numerical and UI fixes.<br/><br/>0.1.25 (2021-01-27):<br/>\u2022 Fixed a minor exploit with ferns.<br/>\u2022 Removed support for savegames before 0.1.7, a very old version that normally isn\'t in use anywhere anymore but added complexity to the codebase to support.<br/><br/>0.1.24 (2021-01-26):<br/>\u2022 Renamed watercress "leech" to "copy". It\'s still the exact same effect, but the name copy is more clear, since it is a strictly positive effect.<br/>\u2022 Increased weather cooldown, growth speed and mushroom economy effects of fruits.<br/>\u2022 "w" keyboard shortcut now also replants existing watercress.<br/>\u2022 More UI tweaks and fixes.<br/><br/>0.1.23 (2021-01-24):<br/>\u2022 UI tweaks and fixes.<br/><br/>0.1.22 (2021-01-24):<br/>\u2022 Added dark mode UI. Option available under preferences.<br/>\u2022 Added support for CSS stylesheets for this.<br/>\u2022 Made all unlocked dynamic in-game help dialogs available in the main help from the settings. More appear as more get unlocked during the game progression.<br/><br/>0.1.21 (2021-01-24):<br/>\u2022 Added achievements chips when new achievement unlocked.<br/>\u2022 Other related UI tweaks: latin number tweaks, tooltip infos<br/><br/>0.1.20 (2021-01-23):<br/>\u2022 New mechanic: mistletoes, twigs resource and ethereal tree leveling.<br/>\u2022 Added new ethereal upgrades and crops, both first-tier and higher ethereal-tree-level-tier ones.<br/>\u2022 Made ethereal season upgrades cheaper (2x instead of 10x cost scaling).<br/>\u2022 Increased ethereal blackberry and champignon boosts from 20% to 25%.<br/>\u2022 Other balance tweaks: more medal bonuses, higher level plants tweaked, ...<br/>\u2022 Renamed "fog ability" to "mist ability".<br/>\u2022 Added help dialog system plus preferences for this<br/><br/>0.1.19 (2021-01-17):<br/>\u2022 Improved winter: still has the harsh effect, but also has positive effect for crops next to tree ("winter tree warmth"), and makes the tree produce more resin when it levels up.<br/>\u2022 Ethereal winter upgrade now more useful: also upgrades those positive winter effects.<br/>\u2022 Added more info about season effects to the dialog gotten from clicking the time/season indicator.<br/><br/>0.1.18 (2021-01-17):<br/>\u2022 Increased starter resources of ethereal fern.<br/>\u2022 Fixed bugs related to leeching and transcension II.<br/><br/>0.1.17 "Fruit update" (2021-01-16):<br/>\u2022 Added fruits.<br/>\u2022 Only one weather ability can be active at the same time now.<br/><br/>0.1.16 (2021-01-09):<br/>\u2022 Added ethereal lotus. Lotus now boosts ethereal neighbors, while clover boosts basic flowers.<br/>\u2022 Added more ethereal upgrades<br/>\u2022 Added more achievements<br/>\u2022 Ethereal mushroom bonus improved: no longer increases consumption.<br/>\u2022 Leeching watercress now leaves a "ghost" remainder when it disappears. No effect, visual reminder of leech spot only.<br/>\u2022 Spore costs and production inflated times 6.66666, no actual consequence other than display, to avoid values with very small exponent with first mushroom.<br/><br/>0.1.15 (2021-01-08):<br/>\u2022 Swapped fog and sun ability (sun is now unlocked first).<br/>\u2022 Improve UI of "choice" upgrades to be single upgrade with a choice dialog<br/>\u2022 Increased unused resin bonus 10x<br/>\u2022 Increased amount of starter resources from ethereal fern and made it scale quadratically<br/>\u2022 Can now only delete new ethereal crops after next transcension<br/>\u2022 Bugfixes<br/><br/>0.1.14 (2020-12-30):<br/>\u2022 Ethereal crops now give 100% resin back on delete, but require ethereal deletion tokens.<br/>\u2022 Buffed watercress to have a more meaningful upgrade for the early game experience.<br/>\u2022 Added a few more achievements.<br/><br/>0.1.13 (2020-12-30):<br/>\u2022 Mushrooms now only get seeds from neighbors, so they can\'t produce spores if they don\'t have berries as neighbors in the field.<br/>\u2022 The global overconsumption system has been removed since this now takes place locally amongst groups of mushroom/berry neighbors.<br/>\u2022 Nettles now also negatively affect neighboring flowers, instead of only berries.<br/>\u2022 Leech effect takes the extra seeds consumption through the mushrooms neighboring producers.<br/>\u2022 Internal field production algorithm updated to support the neighbor-based consumption/production effects.<br/>\u2022 Trees still consume spores globally, mushrooms are not required to be next to the tree. Maybe this makes sense in a future update but it may cause an issue of discoverability when one doesn\'t yet know you want to upgrade the tree.<br/>\u2022 The goal of this is to add more crop interaction and positional elements to the game<br/><br/>0.1.12 (2020-12-28):<br/>\u2022 Fix accidental 7x7 field bug, 6x6 is currently the maximum if the relevant upgrade is purchased.<br/><br/>0.1.11 (2020-12-27):<br/>\u2022 Added back ethereal upgrades (2 for now), now costing resin. The 6x6 field size upgrade is now actually reachable.<br/><br/>0.1.10 (2020-12-26):<br/>\u2022 Internal fixes.<br/><br/>0.1.9 (2020-12-26):<br/>\u2022 The resin and transcension system has been redesigned. There are now multiple ethereal field plant types and they give direct boosts to the basic field. All resin has been refunded and can be re-used with the new system.<br/>\u2022 The pericarps resource has been removed from the game. Nothing is lost from this since only its production per second ("ethereal field power") was used and this was determined by resin which has been refunded.<br/>\u2022 Unused resin also gives a small boost now.<br/>\u2022 The ethereal upgrades (which used to cost ethereal field power) are currently removed (and replaced by ethereal plant effects instead), but new ones, probably costing resin, may be added back in a future game update.<br/>\u2022 A few other minor tweaks, e.g. the savegame now remembers which tab you had open and the assigned shift key plant.<br/><br/>0.1.8 (2020-12-24):<br/>\u2022 Changed the savegame format internally to be more compatible with future updates.<br/>\u2022 Minor tweaks and fixes.<br/><br/>0.1.7 (2020-12-23):<br/>\u2022 Added new plant type: watercress, and made it the starter plant. Also remains important as non-idle (active) plant throughout the game.<br/>\u2022 Nerfed costs and production of other plants to compensate the watercress power.<br/>\u2022 Added "a" keyboard shortcut for abilities.<br/><br/>0.1.6 (2020-12-22):<br/>\u2022 Added undo button.<br/>\u2022 Removed the free replant of same plant type at same spot since undo can be used instead now.<br/>\u2022 Weather abilities unlock immediately rather than through extra upgrade step, and merged their choice upgrades.<br/><br/>0.1.5 (2020-12-21):<br/>\u2022 Added new plant type: nettle<br/>\u2022 Added estimated time counters to several cost tooltips<br/>\u2022 Balancing tweaks<br/>\u2022 Increased ethereal upgrades but still very conservative for now as first run can still get balanced more<br/><br/>0.1.4 (2020-12-20):<br/>\u2022 Added "choice" upgrades<br/>\u2022 Added a third weather ability<br/>\u2022 Made higher level mushrooms produce more spores<br/><br/>0.1.3 (2020-12-19):<br/>\u2022 Added weather abilities<br/>\u2022 Balancing: slightly cheaper 3rth and higher tier plants<br/><br/>0.1.2 (2020-12-19):<br/>\u2022 Slightly boosted fern and it can now also give spores<br/>\u2022 Tweaked the upgrade-button UI<br/><br/>0.1.1 (2020-12-18):<br/>\u2022 Balance changes: fixed too slow beginning of game, but also the too powerful long term upgrade scaling<br/><br/>0.1.0 (2020-12-18):<br/>\u2022 Initial test release, no patches applied yet<br/>\u2022 Since this is a first alpha release, balancing and mechanics can still change quite bit!<br/><br/>Copyright (c) 2020-2022 by Lode Vandevenne'}
